import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Header from '../components/header';

const Mail = () => {
  const navigate = useNavigate();

  // Gantilah logika pengecekan berikut sesuai dengan cara Anda menyimpan informasi login pengguna
  const userIsLoggedIn = false; // Gantilah ini dengan logika sesuai dengan aplikasi Anda

  useEffect(() => {
    // Jika pengguna belum login, arahkan kembali ke halaman login
    if (!userIsLoggedIn) {
      navigate('/');
    }
  }, [userIsLoggedIn, navigate]);

  return (
    <>
      <Header />
      {userIsLoggedIn ? (
        <h2>Halaman Mail bro</h2>
      ) : (
        <p>Anda harus login untuk mengakses halaman ini.</p>
      )}
    </>
  );
};

export default Mail;
